import React, { useState, useEffect } from 'react';
import WebViewer3D from './WebViewer3D';

function App() {
  const [data, setData] = useState(null);
  const [selectedValues, setSelectedValues] = useState({
    DR: '',
    PC: '',
    PM: '',
    ST: '',
    CT: '',
    FD: ''
  });
  const [miDent, setMiDent] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const params = {
          apikey: 'e66120f9d9624823884cac1bf290ea88',
          language: 'english',
          eol: '1',
          plm: 'true',
          includeunclassifiedbycountry: 'false',
          enablePreviewPerLine: 'true',
          path: 'bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj',
          includecrossref: 'true',
        };
        const queryString = new URLSearchParams(params).toString();
        const url = `https://webapi.partcommunity.com/service/table/vertical?${queryString}`;
        const response = await fetch(url);
        const result = await response.json();
        setData(result);
        setSelectedValues({
          DR: result.index.line.values.DR.current,
          PC: result.index.line.values.PC.current,
          PM: result.index.line.values.PM.current,
          ST: result.index.line.values.ST.current,
          CT: result.index.line.values.CT.current,
          FD: result.index.line.values.FD.current
        })
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, []);

  // useEffect(() => {
  //   updateMiDent();
  // }, [selectedValues]);

  const updateMiDent = () => {
    const newMiDent = `{bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj},013 {LINEID=10}  {NB=BOSCH-Rexroth CYTROPAC-1X/20/AF1AS04/2/B/WA/1/7035},{TYP=CYTROPAC: Hydraulic power unit},{CS=1X: Component series 10 to 19},{TS=20: 20 Litre},{DR=${selectedValues.DR}},{PC=${selectedValues.PC}},{PM=${selectedValues.PM}},{OP=2: Maximum operating pressure},{ST=${selectedValues.ST}},{CT=${selectedValues.CT}},{FL=1: Return flow filter},{COL=7035: RAL 7035},{FD=${selectedValues.FD}},{PPATH=cytropac_asmtpl.prj},{BAH005=380},{AAF726=8.3},{AAB456=4000},{BAD915=AC},{AAC830=20},{BAC676=G1},{AAN523=Plug-in connection},{AAG402=1},{AAQ326=https://www.boschrexroth.com/ics/cat/?cat=Industrial-Hydraulics-Catalog&p=p943945},{AAJ413=G1},{BAI539=},{BAB706=}`;
    setMiDent(newMiDent);
  };

  const handleChange = (field, value) => {
    setSelectedValues(prevValues => ({
      ...prevValues,
      [field]: value
    }));
  };

  if (!data) {
    return <div>Loading...</div>;
  }

  const indexPath = data.index.line.values;
  const cnsordernoName = indexPath.CNSORDERNO.desc;
  const cnsordernoValue = { 'name': indexPath.CNSORDERNO.values[0].name, 'value': indexPath.CNSORDERNO.values[0].value };
  const mnName = indexPath.MN.desc;
  const mnValue = { 'name': indexPath.MN.values[0].name, 'value': indexPath.MN.values[0].value };
  const typeName = indexPath.TYP.desc;
  const typeValue = { 'name': indexPath.TYP.values[0].name, 'value': indexPath.TYP.values[0].value };
  const csName = indexPath.CS.desc;
  const csValue = { 'name': indexPath.CS.values[0].name, 'value': indexPath.CS.values[0].value };
  const tsName = indexPath.TS.desc;
  const tsValue = { 'name': indexPath.TS.values[0].name, 'value': indexPath.TS.values[0].value };
  const drName = indexPath.DR.desc;
  const drValues = indexPath.DR.values.map(item => ({ 'name': item.name, 'value': item.value }));
  const pcName = indexPath.PC.desc;
  const pcValues = indexPath.PC.values.map(item => ({ 'name': item.name, 'value': item.value }));
  const pmName = indexPath.PM.desc;
  const pmValues = indexPath.PM.values.map(item => ({ 'name': item.name, 'value': item.value }));
  const opName = indexPath.OP.desc;
  const opValue = { 'name': indexPath.OP.values[0].name, 'value': indexPath.OP.values[0].value };
  const stName = indexPath.ST.desc;
  const stValues = indexPath.ST.values.map(item => ({ 'name': item.name, 'value': item.value }));
  const ctName = indexPath.CT.desc;
  const ctValues = indexPath.CT.values.map(item => ({ 'name': item.name, 'value': item.value }));
  const flName = indexPath.FL.desc;
  const flValue = { 'name': indexPath.FL.values[0].name, 'value': indexPath.FL.values[0].value };
  const colName = indexPath.COL.desc;
  const colValue = { 'name': indexPath.COL.values[0].name, 'value': indexPath.COL.values[0].value };
  const fdName = indexPath.FD.desc;
  const fdValues = indexPath.FD.values.map(item => ({ 'name': item.name, 'value': item.value }));

  return (
    <div>
      <p>{cnsordernoName}: {cnsordernoValue.name}</p>
      <p>{mnName}: {mnValue.name}</p>
      <p>{typeName}: {typeValue.name}</p>
      <p>{csName}: {csValue.name}</p>
      <p>{tsName}: {tsValue.name}</p>
      <form>
        <label>{drName}:</label>
        <select onChange={(e) => handleChange('DR', e.target.value)}>
          {drValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      <br></br>
      <form>
        <label>{pcName}:</label>
        <select onChange={(e) => handleChange('PC', e.target.value)}>
          {pcValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      <br></br>
      <form>
        <label>{pmName}:</label>
        <select onChange={(e) => handleChange('PM', e.target.value)}>
          {pmValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      <p>{opName}: {opValue.name}</p>
      <form>
        <label>{stName}:</label>
        <select onChange={(e) => handleChange('ST', e.target.value)}>
          {stValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      <br></br>
      <form>
        <label>{ctName}:</label>
        <select onChange={(e) => handleChange('CT', e.target.value)}>
          {ctValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      <p>{flName}: {flValue.name}</p>
      <p>{colName}: {colValue.name}</p>
      <form>
        <label>{fdName}:</label>
        <select onChange={(e) => handleChange('FD', e.target.value)}>
          {fdValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
        </select>
      </form>
      {/* <h1>WebViewer3D Demo</h1>
      <WebViewer3D /> */}
      <p>MiDent: {miDent}</p>
    </div>
  );
}

export default App;
